import React, { useState } from "react";

import Course from "./Course"

const Allcourses = ({course}) => {    // pasing object course
    
    // So the setCourses function will update courses
    const [courses,setCourses] = useState([          // useState is a Hook that enables the state
        {title:"Java Course",description:"this is just testing"},
        {title:"Django Course",description:"this is demo"},
        {title:"React Course",description:"this is UI Course"}
    ])    
    

    return(
        <div>
            <h1>All Courses</h1>
        </div>
    )
}

export default Allcourses;
